import React from 'react';
import PizzaCard from './PizzaCard'


const PizzaCardList = (props) => {
	const PizaComponent = props.pizzas.map((pizza, i) => <PizzaCard key={i} pizza={pizza}/>);

  return (
  	<div className="AllSabores">
  	{PizaComponent}
    </div>
  );
};

export default PizzaCardList;
